import React from 'react';
import './Home.css';

export default function Home() {
    return (
        <div className="home">
            <div className="home-container">
                <h1>Mikaela Bukow</h1>
                <p>Hi! I'm Mikaela. I'm currently working as a Software Engineer at Playstation in San Francisco, CA. </p>
            </div>
            <div className='home-btn'>
                About Me
            </div>

        </div>
    )
}
